class Game extends React.Component {

  constructor() {
    super();
    this.state = {
      history: [{
        squares: Array(9).fill(null)
      }],
      xIsNext: true,
      stepNumber: 0
    };
  }

  jumpTo(step) {
    this.setState({
      stepNumber: step,
      xIsNext: step % 2 ? false : true
    });
  }

  handleClick(i) {
    const history = this.state.history;
    const current = history[history.length - 1];
    const squares = current.squares.slice();
    if (calculateWinner(squares, 'Game handleClick') || squares[i]) {
      return;
    }
    squares[i] = this.state.xIsNext ? 'X' : 'O';
    this.setState({
      history: history.concat([{
        squares: squares
      }]),
      xIsNext: !this.state.xIsNext,
      stepNumber: history.length
    });
  }

  render() {
    const history = this.state.history;
    const current = history[this.state.stepNumber];
    const winner = calculateWinner(current.squares, 'Game');
    let status;
    if (winner) {
      status = 'Winner: ' + winner;
    } else {
      status = 'Next player (from Game Component): ' + (this.state.xIsNext ? 'X' : 'O');
    };

    const moves = history.map((step, move) => {
      const desc = move ? 'Move #' + move : 'Game Start';
      return React.createElement(
        "li",
        { key: move },
        React.createElement(
          "a",
          { href: "#", onClick: () => this.jumpTo(move) },
          desc
        )
      );
    });

    return React.createElement(
      "div",
      { className: "game" },
      React.createElement(
        "div",
        { className: "game-board" },
        React.createElement(Board, {
          squares: current.squares,
          onClick: i => this.handleClick(i)
        })
      ),
      React.createElement(
        "div",
        { className: "game-info" },
        React.createElement(
          "div",
          null,
          status
        ),
        React.createElement(
          "ol",
          null,
          moves
        )
      )
    );
  }
}

// ========================================


function calculateWinner(squares, calling) {
  const lines = [[0, 1, 2], [3, 4, 5], [6, 7, 8], [0, 3, 6], [1, 4, 7], [2, 5, 8], [0, 4, 8], [2, 4, 6]];
  console.log('calculateWinner called from ' + calling);
  for (let i = 0; i < lines.length; i++) {
    const [a, b, c] = lines[i];
    if (squares[a] && squares[a] === squares[b] && squares[a] === squares[c]) {
      console.log(lines[i]);
      return squares[a];
    }
  }
  return null;
}

module.exports = Game;

